import React from 'react';
import Header from './Header';
import Main from './Main';
import Footer from './Footer';
import PopupWithForm from './PopupWithForm';

function App() {
  const [isEditAvatarPopupOpen, setEditAvatarPopupOpened] = useState(false);
  const [isAddPlacePopupOpen, setAddPlacePopupOpened] = useState(false);
  const [isEditProfilePopupOpen, setEditProfilePopupOpened] = useState(false);
  const [selectedCard, setSelectedCard] = useState(null);

  function handleCardClick(card) {
    setSelectedCard(card);
  }

  function handleEditAvatarClick() {
    setEditAvatarPopupOpened(true);
  }

  function handleAddPlaceClick() {
    setAddPlacePopupOpened(true);
  }

  function handleEditProfileClick() {
    setEditProfilePopupOpened(true);
  }

  function closeAllPopups() {
    setEditAvatarPopupOpened(false);
    setAddPlacePopupOpened(false);
    setEditProfilePopupOpened(false);
    setSelectedCard(null);
  }
  function handleEditAvatarClick() {
    const popup = document.querySelector('.popup_type_avatar');
    popup.classList.add('popup_opened');
  }

  function handleAddPlaceClick() {
    const popup = document.querySelector('.popup_type_card');
    popup.classList.add('popup_opened');
  }
  return (
    <div className="page">
      <Header />
      <Main
        onEditProfile={handleEditProfileClick}
        onEditAvatar={handleEditAvatarClick}
        onAddPlace={handleAddPlaceClick}
      />
      <Footer />
      <PopupWithForm
        name="profile"
        title="Редактировать профиль"
        buttonText="Сохранить"
        isOpen={isEditProfilePopupOpen}
      >
        <input
          className="popup__input popup__input_type_name"
          id="name-input"
          type="text"
          name="name"
          required
          placeholder="Имя"
          minLength={2}
          maxLength={40}
        />
        <span className="popup__error name-input-error">Вы пропустили это поле</span>
        <input
          className="popup__input popup__input_type_job"
          id="job-input"
          type="text"
          name="about"
          required
          placeholder="О себе"
          minLength={2}
          maxLength={200}
        />
        <span className="popup__error job-input-error">Вы пропустили это поле</span>
      </PopupWithForm>

      <PopupWithForm
        name="avatar"
        title="Обновить аватар"
        buttonText="Сохранить"
        isOpen={isEditAvatarPopupOpen}
      >
        <input
          className="popup__input popup__input_type_avatar-link"
          id="avatar-link-input"
          type="url"
          name="avatar"
          required
          placeholder="Ссылка на картинку"
        />
        <span className="popup__error avatar-link-input-error">Вы пропустили это поле</span>
      </PopupWithForm>

      <PopupWithForm
        name="card"
        title="Новое место"
        buttonText="Создать"
        isOpen={isAddPlacePopupOpen}
      >

            <input
              className="popup__input popup__input_type_card-title"
              id="card-title-input"
              type="text"
              name="name"
              required
              placeholder="Название"
              minLength={2}
              maxLength={30}
            />
            <span className="popup__error card-title-input-error">Вы пропустили это поле</span>
            <input
              className="popup__input popup__input_type_card-link"
              id="card-link-input"
              type="url"
              name="link"
              required
              placeholder="Ссылка на картинку"
            />
            <span className="popup__error card-link-input-error">Вы пропустили это поле</span>
            </PopupWithForm>

      <div className="popup popup_type_confirm">
        <div className="popup__container">
          <h2 className="popup__title">Вы уверены?</h2>
          <button className="popup__close-button" aria-label="Закрыть" type="button" />
          <form className="popup__form popup__form_type_confirm" name="popupForm" noValidate>
            <button className="popup__save-button" type="submit">
              Да
            </button>
          </form>
        </div>
      </div>

      <template id="card-template" />
    </div>
  );
}

export default App;
